import { GET_PAYROLL_SUCCESS } from './action';

const intlTable = {
  payrollTransactionsList: [],
};
interface intlTable {
  payrollTransactionsList: Payroll[];
}
export interface Payroll {
  status: string;
  date: string;
  client: string;
  currentcy: string;
  tolal: number;
  invoice: string;
}
interface Action {
  type: string;
  payload?: any;
}

export default function payrollReducer(state: intlTable = intlTable, action: Action) {
  switch (action.type) {
    case GET_PAYROLL_SUCCESS:
      return { ...state, payrollTransactionsList: action.payload };
    default:
      return state;
  }
}
